import { Event, News } from '../interfaces'

const news_api: News[] = [
    {
        headline: 'test',
        date: 'Dec',
        url: 'google.com',
        image: 'urlhere'
    }
]

/** Dummy user data. */
export const timelineData: Event[] = [
{ 
    id: 0, title: 'Corona Discovered',
    date: 'Dec 21', 
    cases_count: 2,
    news: news_api
},
{ 
      id: 1, 
      title: 'Bob',
      date: 'Jan 9', 
      cases_count: 10
},
{ 
    id: 2, 
    title: 'Caroline', 
    date: 'Jan 15', 
    cases_count: 23
},
{ 
    id: 2,
    title: 'Dave',
    date: 'Jan 27',
    cases_count: 109
},
]


